This will be the route link. For creating link follow below object structure: { title: 'Email', route: 'apps-email', icon: 'MailIcon',
} Let's understand what each property represents: title property will be title (rendered text) of this link. This will be key for i18n. route is vue-router's route name (opens new window). icon property is name of feather icon which will get rendered. You can also use route object as value of route property. { title: 'John Doe', route: { name: 'apps-users-view', params: { id: 21 } }, icon: 'UserIcon',
} Besides internal route of app you can also create link for external sites: { title: 'Documentation', href: 'https://pixinvent.com/demo/vuexy-vuejs-admin-dashboard-template/documentation', icon: 'FileTextIcon',
}
